import  '../node_modules/bootstrap/dist/css/bootstrap.min.css' ;
import {Container,Row,Col} from 'reactstrap'

export default function Footer({styl}) {
    return (
       
            <Container className='footer-container'>

                <h1>contact us</h1>


    <style jsx>{`
    
    
    .footer-container{
      
        background-color:${styl.background}
        color:${styl.color}
    }
    
    `}</style>
            </Container>
        
    )
}
